import React from 'react';
import logo from './logo.svg';
import './App.css';

function App(props) {
  return (
    <div>
      <h1>{props.titl}</h1>
      <input name="usuario" id="usuario" ClassName="usuarioInput" placeholder="Usuario" />
    </div>
  );
}

export default App;
